import React, { Component } from 'react'

import { Table } from 'antd'
const sectionColumns = [
	{
		title: '姓名',
		dataIndex: 'name',
		key: 'name',
	},
	{
		title: '年龄',
		dataIndex: 'age',
		key: 'age',
	},
	{
		title: '住址',
		dataIndex: 'address',
		key: 'address',
	},
]

class SectionCreate extends Component {
	render() {
		return (
			<div className='APP'>
				<Table></Table>
			</div>
		)
	}
}
export default SectionCreate
